This video is all about rocking a red lip.
Most of the people are conscious of wearing a red lipstick, assuming it will be too bright or not suit them. But on the contrary Red lipstick looks classy and sexy if you are wearing it correctly.
This is a little guide or look how you can rock a red lip.
When you want to go for a red lip, always remember eyes should not be too loud because you want the main focus to be your lips so wearing bold eye look will fade the lipstick's beauty away.
For base makeup you can go soft glam or full glam, both will look good.
Choose a good red lipstick that will suit your skintone,
For example,  if you have fair skintone go for a blue tone red, if you have medium to wheatish skintone go for brick red and if you have dusky skintone go for deeper shades of red.
And Waalaa... You'll definitely rock a red lip.
I hope you like and found it helpful and if you do please share this with your friends and follow @obscure_makeup for more such content.

